import React from 'react';

import './card.styles.css';

export const Card = props => {
    return <div className='card-container'>
        <img alt='monster' src={`https://robohash.org/LYP.png?set=set2&size=180x180`}/>
        <h1>{props.monster.name}</h1>
        </div>;
}
